var ET = {
    init: function (is_modal) {
        Ext.BLANK_IMAGE_URL = 'data/img/s.gif';
        Ext.QuickTips.init();
        var opts = {
            selectionTitleAttribute: false,
            templateResult: function (data) {
                if (!data.id) {
                    // OPTGROUP
                    if (data.children) {
                        let $el = $(data.element);
                        if ($el.attr('style')) {
                            return $('<span />').attr('style', $el.attr('style')).html(data.text);
                        }
                    }
                    return data.text;
                }
                let $el = $(data.element);
                // Fontawesome
                if ($el.data('icon')) {
                    return $('<span><i class="fa ' + $el.data('icon') + '"></i> ' + data.text + '</span>');
                }
                // Carré de couleur
                if ($el.data('square')) {
                    return $('<span><span style="border: 1px solid #b7b7b7;background-color:' + $el.data('square') + ';padding:0 6px;margin-right:5px;"></span>' + data.text + '</span>');
                }
                // Texte d'aide (affiché en dessous)
                if ($el.data('help') && $el.data('help') !== '') {
                    return $('<span>' + data.text + '<span style="display:block;font-size:10px;padding-top:3px;">(' + $el.data('help') + ')</span></span>');
                }
                // Style du texte
                if ($el.attr('style')) {
                    return $('<span />').attr('style', $el.attr('style')).html(data.text);
                }
                return data.text;
            }
        };
        $.fn.select2.defaults.set('dropdownAutoWidth', true);
        $.fn.select2.defaults.set('language', 'fr');
        if (is_modal == true) { // BUG select2 si on est dans une popIn
            opts.dropdownParent = $('.x-window');
            $('.x-window .Select:not(.no-select2):not(.select2-hidden-accessible)').select2(opts);
        } else {
            $('.Select:not(.no-select2):not(.select2-hidden-accessible)').select2(opts);
        }
        // check all Select2
        $('.Select[multiple]').not('.no-select-all').siblings('.select2-container').append('<span class="select-all" title="Tout sélectionner"><i class="fa fa-check-square"></i></span>');
        $('.select-all').off('click').on('click', function (e) {
            selectAllSelect2($(this).siblings('.selection').find('.select2-search__field'));
        });
        function selectAllSelect2(that)
        {
            var selectAll = true;
            var existUnselected = false;
            var item = $(that.parents("span[class*='select2-container']").siblings('select[multiple]'));
            item.find("option").each(function (k, v) {
                if (!$(v).prop('selected')) {
                    existUnselected = true;
                    return false;
                }
            });
            selectAll = existUnselected ? selectAll : !selectAll;
            item.find("option").prop('selected', selectAll);
            item.trigger('change');
        }
        
        ET.initPopover();
        ET.initNoty();
        ET.initUi();
    },
    initEkko: function() {
        $(document).on('click', '[data-toggle="lightbox"]', function (event) {
            event.preventDefault();
            $(this).ekkoLightbox();
        });
    },
    initPopover: function () {
        $('.popover.show').remove();
        // Popover
        $('[data-toggle="popover"]').popover({
            html: true,
            sanitize: false,
            content: function () {
                return ($(this).data('target-id') ? $($(this).data('target-id')).html() : '');
            }
        });
        $('[title]:not([title=""]:not([data-toggle="popover"])').popover({
            html: true,
            sanitize: false,
            trigger: 'hover',
            template: '<div class="popover" role="tooltip"><div class="arrow"></div><div class="popover-body"></div></div>',
            content: function () {
                return $(this).attr('data-original-title');
            }
        });
        
    },
    initNoty: function () {
        Noty.overrideDefaults({
            layout: 'topRight',
            theme: 'bootstrap-v4',
            closeWith: ['click', 'button'],
            animations: {
                open: 'animated fadeInRight',
                close: 'animated fadeOutRight'
            }
        });
    },
    // On enregistre le statut des cards minimisées (elles doivent avoir un ID)
    initUi: function() {
        let interfaceName = 'interface';
        let interfaceData = {collapsed: []};
        let interfaceStorage = localStorage.getItem(interfaceName);
        if (interfaceStorage != null) {
            interfaceData = JSON.parse(interfaceStorage);
        } else {
            localStorage.setItem(interfaceName, JSON.stringify(interfaceData));
        }
        // Minimized cards
        interfaceData.collapsed.forEach(x => {
            $('.card#' + x).find('[data-card-widget="collapse"]').click().trigger('collapsed.lte.cardwidget');
        });
        $('[data-card-widget="collapse"]').off('click').on('click', function () {
            let thisCardId = $(this).closest('.card').attr('id');
            let interfaceData = JSON.parse(localStorage.getItem(interfaceName));
            let exists = interfaceData.collapsed.includes(thisCardId);
            if (exists) {
                interfaceData.collapsed = interfaceData.collapsed.filter(e => e !== thisCardId);
            } else {
                interfaceData.collapsed.push(thisCardId);
            }
            localStorage.setItem(interfaceName, JSON.stringify(interfaceData));
        });
    },
    overlib_popover: function(el, title, content, popover_id)
    {
        let $pop = $('.popover');
        if ($pop.length === 0 || $pop.attr('data-id') != popover_id) {
            $pop.popover('dispose');
            el.attr('data-toggle', 'popover')
                .attr('data-title', title)
                .attr('data-content', '<div style="max-height:300px;overflow-y: auto;">'+content+'</div>');
            ET.initPopover();
            el.popover('show');
            $pop.attr('data-id', popover_id).on('mouseleave', function(){
                el.popover('dispose');
            });
        }
    },
    
    delay(callback, ms)
    {
        let timer = 0;
        return function () {
            let context = this, args = arguments;
            clearTimeout(timer);
            timer = setTimeout(function () {
                callback.apply(context, args);
            }, ms || 0);
        };
    }
}
