function hideAjaxWait()
{
    document.body.style.cursor = 'default';
    $('#ajax-wait').css('visibility', 'hidden');
}
function showAjaxWait()
{
    document.body.style.cursor = 'wait';
    $('#ajax-wait').css('visibility', 'visible');
}
var loadPage = function (url, params, method, el) {
    if (url === undefined) {
        return;
    }
    if (params === undefined) {
        params = {};
    }
    if (method === undefined) {
        method = 'GET';
    }
    if (el === undefined) {
        el = 'ajax_content';
    }
    if (typeof refreshTimer !== 'undefined') {
        clearInterval(refreshTimer);
        clearTimeout(refreshTimer);
        delete refreshTimer;
    }
    ET_Alive.clear();
    if (typeof g_win !== 'undefined') {
        g_win.close();
    }
    if (typeof runner !== 'undefined') {
        runner.stopAll();
    }
    if (typeof ETCal !== 'undefined') {
        delete ETCal;
        return true;
    }
    ndx(500);
    showAjaxWait();
    ET_MenuFav.set('', '', '', []);
    // Attention, la conversion de cette partie vers jQuery pose un souci car les variables injectées dans el.html() ne peuvent pas être redéfinies
    let requestId = Ext.Ajax.request({
        url: url, params: params, method: method, autoAbort: true, timeout: 90000,
        success: function (req) {
            Ext.fly(el).update(req.responseText, true, function () {
                hideAjaxWait();
                ET.init();
            });
        },
        failure: function (xhr) {
            hideAjaxWait();
            alert('Erreur de chargement de la page, merci de recharger la page (' + xhr.statusText + ')');
        }
    });
    // Permet de stopper la requête de loadPage avec ESC
    $(document).on('keydown', function (e) {
        if (e.key === 'Escape') {
            hideAjaxWait();
            if (typeof requestId === 'object') {
                Ext.Ajax.abort(requestId);
            }
        }
    })
    return false;
};
function popIn(opts)
{
    if (typeof g_win == 'undefined') {
        g_win = null;
    }
    // Options par défaut
    var defaults = {
        close: true,
        width: 880,
        height: 640,
        y: false, // pas recommandé, mieux vaut laisser la fenêtre au milieu, si spécifié, le height saute
        title: '',
        html: false, // contenu HTML ou source Ajax si false
        url: '',
        method: 'GET',
        params: {},
        bodyStyle: '',
        modal: true,
        draggable: true,
        resizable: false,
        closable: true,
        autoScroll: 'auto'
    };
    opts = $.extend({}, defaults, opts || {});
    if (opts.close === true)
    {
        if (typeof g_win !== 'undefined' && g_win !== null) {
            g_win.close();
        }
        if (typeof ET_PlgAttrib !== 'undefined' && typeof ET_PlgAttrib.g_win !== 'undefined' && ET_PlgAttrib.g_win !== null) {
            ET_PlgAttrib.g_win.close();
        }
    }
    var winOpts = {
        width: opts.width,
        height: opts.height,
        autoScroll: opts.autoScroll,
        title: opts.title,
        layout: 'fit',
        resizable: opts.resizable,
        modal: opts.modal,
        draggable: opts.draggable,
        closable: opts.closable,
        bodyStyle: ''
    };
    if (opts.y !== false) {
        winOpts.y = opts.y;
        delete winOpts.height;
    }
    if (typeof opts.buttons !== 'undefined') {
        winOpts.buttons = opts.buttons;
    }
    if (opts.html !== false || opts.url === '') {
        winOpts.html = opts.html;
    }
    else
    {
        winOpts.autoLoad = {
            url: opts.url,
            method: opts.method.toUpperCase(),
            params: opts.params,
            scripts: true,
            nocache: true,
            callback: function (el, success) {
                if (success === true) {
                    ET.init(true);
                }
            }
        };
    }
    g_win = new Ext.Window(winOpts);
    g_win.show();
}
function popUp(URL, w, h, id)
{
    const top = window.top.outerHeight / 2 + window.top.screenY - ( h / 2);
    const left = window.top.outerWidth / 2 + window.top.screenX - ( w / 2);
    var popup = window.open(URL, 'popup' + (typeof (id) != 'undefined' ? id : ''), 'toolbar=0,scrollbars=1,location=0,status=1,menubar=0,resizable=1,width=' + w + ',height=' + h + ',top=' + top + ',left=' + left);
    if (popup == null) {
        alert('Une erreur est survenue. Veuillez désactiver le bloqueur de popup');
    }
    else
    {
        popup.focus();
    }
}
// Post un formulaire dans une popup, utile pour passer beaucoup d'argument
function postUp(w, h)
{
    var form = $('#FORM_POSTFORM');
    if (form.length)
    {
        const top = window.top.outerHeight / 2 + window.top.screenY - ( h / 2);
        const left = window.top.outerWidth / 2 + window.top.screenX - ( w / 2);
        
        var postWindow = window.open('', "POSTFORM", 'toolbar=0,scrollbars=1,location=0,status=1,menubar=0,resizable=1,width=' + w + ',height=' + h + ',top=' + top + ',left=' + left);
        if (postWindow) {
            form.trigger('submit');
        }
        else {
            alert('Une erreur est survenue. Veuillez désactiver le bloqueur de popup');
        }
    }
}
function popUpWide(URL, height, id)
{
    let width = (screen.width > 1800 ? 1800 : screen.width);
    let posX = (screen.width - width) / 2;
    let posY = (screen.height - height) / 2;
    let popup = window.open(URL, 'popup' + (typeof (id) != 'undefined' ? id : ''), 'toolbar=0,scrollbars=1,location=0,status=1,menubar=0,resizable=1,width=' + width  + ',height=' + height + ',top=' + posY + ',left=' + posX);
    if (popup == null) {
        alert('Une erreur est survenue. Veuillez désactiver le bloqueur de popup');
    }
    else
    {
        popup.resizeTo(width, height);
        popup.moveTo(posX, posY);
        popup.focus();
    }
}
