function crypt_url(ipt)
{
    var keyStr = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";
    var output = '?u=';
    var chr1, chr2, chr3;
    var enc1, enc2, enc3, enc4;
    var i = 0;
    do {
        chr1 = ipt.charCodeAt(i++);
        chr2 = ipt.charCodeAt(i++);
        chr3 = ipt.charCodeAt(i++);
        enc1 = chr1 >> 2;
        enc2 = ((chr1 & 3) << 4) | (chr2 >> 4);
        enc3 = ((chr2 & 15) << 2) | (chr3 >> 6);
        enc4 = chr3 & 63;
        if (isNaN(chr2)) {
            enc3 = enc4 = 64;
        } else if (isNaN(chr3)) {
            enc4 = 64;
        }
        output = output + keyStr.charAt(enc1) + keyStr.charAt(enc2) + keyStr.charAt(enc3) + keyStr.charAt(enc4);
    } while (i < ipt.length);
    return output;
}
function expandDiv(id, hideShowForce)
{
    if (typeof hideShowForce == 'undefined') {
        hideShowForce = null;
    }
    let $img = $('#' + id + '_img');
    let $i = $('#' + id + '_img i');
    let $div = $('#' + id + '_div');
    if (!$div.is(':visible') && (hideShowForce === null || hideShowForce === true)) {
        if ($img.attr('src')) {
            $img.attr('src', 'data/img/up.gif');
        } else {
            $i.removeClass('fa-chevron-circle-down');
            $i.addClass('fa-chevron-circle-up');
        }
        $div.show();
    } else if ($div.is(':visible') && (hideShowForce === null || hideShowForce === false)) {
        if ($img.attr('src')) {
            $img.attr('src', 'data/img/down.gif');
        } else {
            $i.removeClass('fa-chevron-circle-up');
            $i.addClass('fa-chevron-circle-down');
        }
        $div.hide();
    }
}
