function checkPassword(field)
{
    var password = $('#' + field).val();
    if (!password || !$('#' + field).length || !$('#' + field + '_MSG').length) return;
        //var regExp = /(?=.*\d)(?=.*[a-z])(?=.*[A-Z])(?=.*[!\-@_#$%&*]).{8,}/;*/
    var regExp = /(?=.*[a-z])(?=.*[A-Z])(?=.*\d).{8,}/;
    var validPassword = regExp.test(password);
    if (!validPassword) {
        $('#' + field).focus();
        $('#' + field + '_MSG').show();
        return false;
    } else {
        $('#' + field + '_MSG').hide();
        return true
    }
