{
    if (form.elements[elem] === 'undefined' || form.elements[elem] === undefined) {
        return;
    }
    var elts = form.elements[elem];
    if (elts === null || typeof (elts) == 'undefined') {
        return;
    }
    if (typeof (elts.length) == 'undefined') {
        elts.checked = !elts.checked;
    }
    for (var i = 0; i < elts.length; i++) {
        if (elts[i].disabled == '') {
            elts[i].checked = value;
        }
    }
