function alert_ext(title, msg, fn, icon)
{
    var params = {
        backgroundDismiss: true,
        type: 'red',
        theme: 'light',
        icon: 'fa fa-warning',
        title: title,
        content: msg,
        onDestroy: function () {
            fn.call(this)
        },
        buttons: {
            specialKey: {
                text: 'OK',
                keys: ['enter'],
                action: function () {
                    this.close();
                }
            }
        }
    };
    $.alert(params);
}

function alert_jquery(title, msg, width, on_destroy, type, icon, buttons)
{
    if (typeof type == 'undefined') {
        type = 'red';
    }
    if (typeof icon == 'undefined') {
        icon = 'fa fa-warning';
    }
    if (typeof buttons == 'undefined')
    {
        buttons = {
            specialKey: {
                text: 'OK',
                keys: ['enter'],
                action: function () {
                    this.close();
                }
            }
        };
    }
    var params = {
        backgroundDismiss: true,
        type: type,
        theme: 'light',
        icon: icon,
        title: title,
        content: msg,
        buttons: buttons
    };
    if (typeof width != 'undefined' && width !== '') {
        params['boxWidth'] = width;
        params['useBootstrap'] = false;
    }
    if (typeof on_destroy === 'function') {
        params['onDestroy'] = on_destroy;
    }
    $.alert(params);
}
function confirm_jquery(title, msg, callbacks, btns)
{
    if (typeof btns === 'undefined')
    {
        btns = {
            confirm: {
                keys: ['enter'],
                text: 'Confirmer',
                btnClass: 'btn-red',
                action: function ()
                {
                    if (typeof callbacks.confirm !== 'undefined') {
                        callbacks.confirm.call(this);
                    }
                }
            },
            close: {
                text: 'Annuler',
                action: function ()
                {
                    if (typeof callbacks.close !== 'undefined') {
                        callbacks.close.call(this);
                    }
                }
