function dFilterReplace(fullString, text, by)
{
    var strLength = fullString.length;
    var txtLength = text.length;
    if (strLength === 0 || txtLength === 0) {
        return fullString;
    }
    var i = fullString.indexOf(text);
    if (i === 0 && (text != fullString.substring(0, txtLength))) {
        return fullString;
    }
    if (i == -1) {
        return fullString;
    }
    var newstr = fullString.substring(0, i) + by;
    if (i + txtLength < strLength) {
        newstr += dFilterReplace(fullString.substring(i + txtLength, strLength), text, by);
    }
    return newstr;
}
function dFilterStrip(dFilterTemp, dFilterMask)
{
    dFilterMask = dFilterReplace(dFilterMask, '#', '');
    for (var i = 0; i < dFilterMask.length++; i++) {
        dFilterTemp = dFilterReplace(dFilterTemp, dFilterMask.substring(i, i + 1), '');
    }
    return dFilterTemp;
}
function dFilterMax(dFilterMask)
{
    var dFilterTemp = dFilterMask;
    for (var i = 0; i < (dFilterMask.length + 1); i++) {
        if (dFilterMask.charAt(i) != '#') {
            dFilterTemp = dFilterReplace(dFilterTemp, dFilterMask.charAt(i), '');
        }
    }
    return dFilterTemp.length;
}
function dFilter(key, textbox, dFilterMask)
{
    if (Ext.isOpera) {
        return;
    }
    var dFilterNum = dFilterStrip(textbox.value, dFilterMask);
    var dFilterFinal = '';
    if (key > 95) {
        key -= (95 - 47);
    }
    if (key == 9) {
        return true;
    } else if (key == 8 && dFilterNum.length !== 0) {
        dFilterNum = dFilterNum.substring(0, dFilterNum.length - 1);
    } else if (((key > 47 && key < 58) || (key > 95 && key < 106)) && dFilterNum.length < dFilterMax(dFilterMask)) {
        dFilterNum = dFilterNum + String.fromCharCode(key);
    }
    for (var i = 0; i < dFilterMask.length; i++) {
        if (dFilterMask.charAt(i) == '#') {
            if (dFilterNum.length !== 0) {
                dFilterFinal = dFilterFinal + dFilterNum.charAt(0);
                dFilterNum = dFilterNum.substring(1, dFilterNum.length);
            }
        } else if (dFilterMask.charAt(i) != '#') {
            dFilterFinal = dFilterFinal + dFilterMask.charAt(i);
        }
    }
    if (dFilterStrip(dFilterFinal, dFilterMask) === '') {
        dFilterFinal = '';
    }
    textbox.value = dFilterFinal;
    return false;
}
function strtr(str, from, to)
{
    var fr = '', i = 0, j = 0, lenStr = 0, lenFrom = 0, tmpStrictForIn = false, fromTypeStr = '', toTypeStr = '',
        istr = '';
    var tmpFrom = [];
    var tmpTo = [];
    var ret = '';
    var match = false;
    if (typeof from === 'object') {
        tmpStrictForIn = this.ini_set('phpjs.strictForIn', false);
        from = this.krsort(from);
        this.ini_set('phpjs.strictForIn', tmpStrictForIn);
        for (fr in from) {
            if (from.hasOwnProperty(fr)) {
                tmpFrom.push(fr);
                tmpTo.push(from[fr])
            }
        }
        from = tmpFrom;
        to = tmpTo
    }
    lenStr = str.length;
    lenFrom = from.length;
    fromTypeStr = typeof from === 'string';
    toTypeStr = typeof to === 'string';
    for (i = 0; i < lenStr; i++) {
        match = false;
        if (fromTypeStr) {
            istr = str.charAt(i);
            for (j = 0; j < lenFrom; j++) {
                if (istr == from.charAt(j)) {
                    match = true;
                    break
                }
            }
        } else {
            for (j = 0; j < lenFrom; j++) {
                if (str.substr(i, from[j].length) == from[j]) {
                    match = true;
                    i = (i + from[j].length) - 1;
                    break
                }
            }
        }
        if (match) {
            ret += toTypeStr ? to.charAt(j) : to[j]
        } else {
            ret += str.charAt(i)
        }
    }
    return ret;
}
function getCursorPos(input)
{
    if ("selectionStart" in input && document.activeElement == input) {
        return {
            start: input.selectionStart,
            end: input.selectionEnd
        };
    } else if (input.createTextRange) {
        var sel = document.selection.createRange();
        if (sel.parentElement() === input) {
            var rng = input.createTextRange();
            rng.moveToBookmark(sel.getBookmark());
            for (var len = 0;
                 rng.compareEndPoints("EndToStart", rng) > 0;
                 rng.moveEnd("character", -1)) {
                len++;
            }
            rng.setEndPoint("StartToStart", input.createTextRange());
            for (var pos = {start: 0, end: len};
                 rng.compareEndPoints("EndToStart", rng) > 0;
                 rng.moveEnd("character", -1)) {
                pos.start++;
                pos.end++;
            }
            return pos;
        }
    }
    return -1;
}
function setCursorPos(input, start, end)
{
    if (arguments.length < 3) end = start;
    if ("selectionStart" in input) {
        setTimeout(function () {
            input.selectionStart = start;
            input.selectionEnd = end;
        }, 1);
    } else if (input.createTextRange) {
        var rng = input.createTextRange();
        rng.moveStart("character", start);
        rng.collapse();
        rng.moveEnd("character", end - start);
        rng.select();
    }
}
var timeout_checklenSMS = null;
function checklenSMS()
{
    clearTimeout(timeout_checklenSMS);
    timeout_checklenSMS = setTimeout(function () {
        var maxLength = 160;
        var text = document.getElementById('sms_text');
        var st = text.scrollTop;
        var currentPos = getCursorPos(text);
        // On converti tous les caractères unicodes qui peuvent l'être
        text.value = strtr(text.value,
            "ÀÁÂÃÈÊËÌÍÎÏÐÒÓÔÕÙÚÛÝŸáâãêëíîïðóôõúûµýÿçÞ°¨^«»|\\‚„…‘'“”•–—´`",
            "AAAAEEEIIIIDOOOOUUUYYaaaeeiiioooouuuyycyo--\"\"I/,,.''\"\".--''"
        );
        // https://regex101.com/
        // On supprime tous les caractères non GSM étendus https://en.wikipedia.org/wiki/GSM_03.38
        text.value = text.value.replace(/[^@£\$¥èéùìòÇ\nØø\rÅåΔ_ΦΓΛΩΠΨΣΘΞÆæßÉ !\\"#¤%&'()*+,-\.\/0123456789:;<=>\?¡ABCDEFGHIJKLMNOPQRSTUVWXYZÄÖÑÜ§¿abcdefghijklmnopqrstuvwxyzäöñüà\|\^€{}\[\]~]/g, '');
        // On supprime les caractères qui comptent double (on pourrait les garder, mais il faut changer la méthode de comptage SQL
        text.value = strtr(text.value, "|^€{}[]~\\", "I-E\"\"\"\"-/");
        text.scrollTop = st;
        // On repositionne le curseur là où il était lors du remplacement
        if (currentPos != -1) {
            setCursorPos(text, currentPos.start, currentPos.end);
        }
        var text_len = text.value.length;
        
        // On compte les URL ES par leur équivalent en raccourci
        var matches = text.value.match(/(http.*)(@RESERVE_URL|@VALID_URL|@REFUS_URL|@INDISPO_URL|@DEMANDE_DISPO_URL|@DEMANDE_DISPO_RESA_URL|@CONFIRM_URL)/g);
        if (matches) {
            matches.forEach(function (s) {
                text_len -= (s.length - 12); // 12 = is.gd/dmkdmd
            });
        }
        document.getElementById('sms_nb').innerHTML = text_len;
        if (text_len > 160) {
            maxLength = 153;
        }
        document.getElementById('sms_qte').innerHTML = Math.ceil(text_len / maxLength).toString();
        if (text_len > 6 * 153) {
            text.value = text.value.substr(0, 6 * 153);
            alert('Vous ne pouvez pas envoyer plus de 6 SMS en une fois');
        }
    }, 250);
}
