function liveEditText(el, edit)
{
    if (edit === true && Ext.get(el).dom.childNodes[0].nodeType == '3') {
        Ext.get(el).dom.innerHTML = '<input type="text" class="Input" size="' + (Ext.get(el).dom.innerHTML.length + 1) + '" value="' + Ext.get(el).dom.innerHTML + '" onblur="liveEditText(this.parentNode, false);" />';
        Ext.get(el).dom.childNodes[0].select();
        Ext.get(el).dom.childNodes[0].focus();
    } else if (edit === false && Ext.get(el).dom.childNodes[0].value) {
        Ext.get(el).dom.innerHTML = Ext.get(el).dom.childNodes[0].value.replace(' ', '&nbsp;');
    }
}
