function prevMonth(dt)
{
    var thisMonth = dt.getMonth();
    dt.setMonth(thisMonth - 1);
    if (dt.getMonth() != thisMonth - 1 && (dt.getMonth() != 11 || (thisMonth == 11 && dt.getDate() == 1))) {
        dt.setDate(0);
    }
    return dt;
}
function nextMonth(dt)
{
    var thisMonth = dt.getMonth();
    dt.setMonth(thisMonth + 1);
    if (dt.getMonth() != thisMonth + 1 && dt.getMonth() != 0) {
        dt.setDate(0);
    }
    return dt;
}
