function update_pers_total(plg_id, fonc_id, equ_id, md5_criteres)
{
    var persFonc = 'persFonc_' + plg_id + '_' + fonc_id + '_' + equ_id;
    var persFoncRes = 'perFoncRes_' + plg_id + '_' + fonc_id + '_' + equ_id;
    var persFoncTd = 'persFoncTd_' + plg_id + '_' + fonc_id + '_' + equ_id;
    if (typeof (md5_criteres) !== 'undefined' && md5_criteres !== '') {
        persFonc += '_' + md5_criteres;
        persFoncRes += '_' + md5_criteres;
        persFoncTd += '_' + md5_criteres;
    }
    if (!Ext.get(persFonc) || !Ext.get(persFoncRes)) {
        return;
    }
    var total = 0;
    Ext.select('.pers_' + plg_id + '_' + fonc_id + '_' + equ_id).each(function (item) {
        if (item.hasClass('b-green') || item.hasClass('b-green-supp') || item.hasClass('b-green-confirm-supp') || item.hasClass('b-green-confirm')) {
            // On prend le data si il y a regroupement des sous traitants (poids)
            if (typeof item.dom.dataset.compteur !== 'undefined')
            {
                total += parseInt(item.dom.dataset.compteur);
            }
            else
            {
                total++;
            }
        }
    });
    if (parseFloat(Ext.get(persFoncRes).dom.innerHTML) != total) {
        Ext.get(persFonc).dom.style.color = 'red';
    } else {
        Ext.get(persFonc).dom.style.color = 'green';
    }
    Ext.get(persFonc).dom.innerHTML = total;
    total = 0;
    Ext.select('.persFonc_' + plg_id).each(function (item) {
        total += parseFloat(item.dom.innerHTML || 0);
    });
    if (parseFloat(Ext.get('totalpersRes_' + plg_id).dom.innerHTML) != total) {
        Ext.get('totalpers_' + plg_id).dom.style.color = 'red';
    }
    else {
        Ext.get('totalpers_' + plg_id).dom.style.color = 'green';
    }
    Ext.get('totalpers_' + plg_id).dom.innerHTML = Math.round(total * 100) / 100;
    if (parseFloat(Ext.get('totalpers_' + plg_id).dom.innerHTML) === 0 && parseFloat(Ext.get('totalpersRes_' + plg_id).dom.innerHTML) === 0) {
        // Mis en commentaire car lorsque l'on décale une personne, le total (en option) disparait
        //Ext.get('totalpersTd_'+plg_id).hide();
    } else {
        Ext.get('totalpersTd_' + plg_id).show();
    }
    if (parseFloat(Ext.get(persFonc).dom.innerHTML) === 0 && parseFloat(Ext.get(persFoncRes).dom.innerHTML) === 0) {
        //Ext.get(persFoncTd).hide();
    } else {
        Ext.get(persFoncTd).show();
    }
}
