var dcTime = 250;    // doubleclick time
var dcDelay = 100;   // no clicks after doubleclick
var dcAt = 0;        // time of doubleclick
var savEvent = null; // save Event for handling doClick().
var savEvtTime = 0;  // save time of click event.
var savTO = null;    // handle of click setTimeOut
var savElems = null;
var savChantId = null;
function doAct(click, chant_id, elems, unique_id)
{
    var sal_id = elems[0];
    var plg_id = elems[1];
    var fonc_id = elems[2];
    var equ_id = elems[3];
    let md5_criteres = '';
    if (typeof elems[4] != 'undefined') {
        md5_criteres = elems[4];
    }
    let td = Ext.get('btd_' + sal_id + '_' + plg_id + '_' + fonc_id + '_' + equ_id + '_' + unique_id);
    if (md5_criteres != '') {
        td = Ext.get('btd_' + sal_id + '_' + plg_id + '_' + fonc_id + '_' + equ_id + '_' + unique_id + '_' + md5_criteres);
    }
    //alert('btd_'+sal_id+'_'+plg_id+'_'+fonc_id+'_'+equ_id);
    //var cale    = elems[4];
    g_actUrl = (typeof g_actUrl !== 'undefined' ? g_actUrl : 'data/cgi-bin/'); // à écraser pour un affichage standalone
    // VERIFICATION DECALAGE
    var act = 0;
    if (td.hasClass('b-green') || td.hasClass('b-green-supp')) { // CALE -> PLANIFIE
        act = 1;
    }
    else if (td.hasClass('b-orange') || td.hasClass('b-yellow') || td.hasClass('b-orange-supp')) { // PLANIFIE OU RESERVE -> SUPPRIME
        act = 2;
    }
    else if (!td.hasClass('b-green') && !td.hasClass('b-orange')) { // SUPPRIME -> PLANIFIE
        act = 3;
    }
    if (click == 1 && (td.hasClass('b-orange') || td.hasClass('b-yellow') || td.hasClass('b-orange-supp'))) { // PLANIFIE OU RESERVE -> CALE
        act = 4;
    }
    if (td.hasClass('b-green-confirm') || td.hasClass('b-green-confirm-supp')) {  // CONFIRMÉ -> CALE
        act = 5;
    }
    if (td.hasClass('b-black')) {  // INDISPO -> CALE
        act = 6;
    }
    if (td.hasClass('b-red-2')) {  // ABSENT
        act = 9;
    }
    if (td.hasClass('b-red-3')) {  // REFUS
        act = 10;
    }
    Ext.Ajax.request({
        url: g_actUrl + 'ajax_prestations.php',
        params: {
            action: 'personnel-mod',
            md5_criteres: md5_criteres,
            act: act,
            chant_id: chant_id,
            sal_id: sal_id,
            plg_id: plg_id,
            fonc_id: fonc_id,
            equ_id: equ_id,
            unique_id : unique_id
        },
        method: 'GET',
        timeout: 60000,
        success: function (req) {
            Ext.fly('del_pers_manager').update(req.responseText, true);
            //update_compteur_salarie(elems);
        },
        failure: function (req) {
            alert('Erreur action : ' + act);
        }
    });
}
function hadDoubleClick()
{
    return (((new Date).getTime() - dcAt) < dcDelay);
}
function doClick(which, chant_id, elems, unique_id)
{
    if (savEvtTime - dcAt <= 0) {
        return false;
    }
    doAct(0, chant_id, elems, unique_id);
}
function doDoubleClick(which, chant_id, elems, unique_id)
{
    dcAt = (new Date).getTime();
    if (savTO !== null) {
        clearTimeout(savTO); // clear pending click
        savTO = null;
    }
    doAct(1, chant_id, elems, unique_id);
}
function select_phase(which, chant_id, el, unique_id)
{
    savElems = el;
    savChantId = chant_id;
    switch (which) {
        case "click":
            if (hadDoubleClick()) {
                return false;
            }
            savEvent = which;
            d = new Date();
            savEvtTime = d.getTime();
            savTO = setTimeout(function () {
                doClick(savEvent, savChantId, savElems, unique_id);
            }, dcTime);
            break;
        case "dblclick":
            doDoubleClick(which, chant_id, el, unique_id);
            break;
        default:
    }
}
