        total = 0;
        Ext.select('.matCub_' + plg_id).each(function (item) {
            total += parseInt(item.dom.innerHTML, 10);
        });
        if (parseInt(Ext.get('totalmatRes_' + plg_id).dom.innerHTML, 10) != total) {
            Ext.get('totalmat_' + plg_id).dom.style.color = 'red';
        } else {
            Ext.get('totalmat_' + plg_id).dom.style.color = 'green';
        }
        Ext.get('totalmat_' + plg_id).dom.innerHTML = total;
        if (total == 0) {
            total = '0';
        }
        if (parseInt(Ext.get('totalmat_' + plg_id).dom.innerHTML, 10) === 0 && parseInt(Ext.get('totalmatRes_' + plg_id).dom.innerHTML, 10) === 0) {
            Ext.get('totalmatTd_' + plg_id).hide();
