    // méthode utilisée pour update toute la ligne de fonc besoin
    // utilisée avec update_demp_full_row
    update_demp_each: function (val, fonc_id, plg_id, equ_id, md5_criteres) {
        return $.ajax({
            url: 'data/cgi-bin/ajax_prestations.php',
            method: 'GET',
            data: {
                action: 'besoins-personnel-mod',
                md5_criteres: md5_criteres,
                chant_id: this.chant_id,
                plg_id: plg_id,
                fonc_id: fonc_id,
                equ_id: equ_id,
                nb: parseFloat(val),
            }
        });
    },
    update_demp_full_row: function (val, fonc_id, plg_ids, equ_id, md5_criteres) {
        // Si l'utilisateur n'a rien saisi, on ne fait rien
        val = Number(val);
        if (val != "" && val != 0 ) {
            // ici on appelle update_demp_each de manière séquencielle
            const executeNext = (index) => {
                if (index < plg_ids.length) {
                    const plg_id = plg_ids[index];
                    this.update_demp_each(val, fonc_id, plg_id, equ_id, md5_criteres)
                        .then(result => {
                            executeNext(index + 1);
                        })
                        .catch(err => {
                            console.error(`Error for plg_id ${plg_id}: ${err}`);
                        });
                }else{
                    // une fois que ensemble de la ligne est update on recharge la page
                    // a améliorer avec un refresh ajax
                    $('.refresh-icon').trigger('click');
                }
            };
            executeNext(0);
        } else if (val == 0) {
            alert_jquery('Nombre non valide', 'Veuillez saisir une valeure supérieur à 0');
        } else {
            alert_jquery('Valeur non valide', 'La valeure saisie nest pas valide');
        }
    },
    update_total: function (id) {
        var total = 0;
        Ext.select('.rps_' + id).each(function (item) {
            total += parseFloat(item.dom.value || 0);
        });
        Ext.fly('totalrp_' + id).dom.innerHTML = Math.round(total * 100) / 100;
    },
    del_demp: function (fonc_id, equ_id, md5_criteres) {
