                    ids: this.plg_ids.toString(),
                    fonc_id: fonc_id,
                    equ_id: equ_id,
                    md5_criteres: md5_criteres
                },
                method: 'GET',
                success: function (req) {
                    Ext.fly('rps_manager').update(req.responseText, true);
                    update_filtres_besoins();
                }
            });
        }
        return false;
    },
    update_qte: function (val) {
        if (val == '') return;
        for (var i = 0; i < this.plg_ids.length; i++) {
            Ext.fly('DEMP_NB_' + this.plg_ids[i]).dom.value = val;
        }
    },
    add_demp: function (md5_criteres) {
        let elem_focused = document.activeElement;
        if (elem_focused.className.indexOf('DEMP_NB') != -1 || elem_focused.className.indexOf('btn_add') != -1) {
            ET_BesoinPerso.update_qte(Ext.get('demp-value').dom.value);
            var idvalues = [];
            for (var i = 0; i < this.plg_ids.length; i++) {
                let qte = parseInt(Ext.fly('DEMP_NB_' + this.plg_ids[i]).getValue());
                if (qte > 0) {
                    idvalues.push(this.plg_ids[i] + '_' + Ext.fly('DEMP_NB_' + this.plg_ids[i]).getValue());
                }
            }
            if (idvalues != []) {
                Ext.Ajax.request({
                    url: 'data/cgi-bin/ajax_prestations.php',
                    params: {
                        action: 'besoins-personnel-add',
                        chant_id: this.chant_id,
                        ids: idvalues.toString(),
                        fonc_id: Ext.fly('DEMP_FONC_ID').getValue()
                    },
                    method: 'GET',
                    success: function (req) {
                        if (typeof window.g_currentFoncs != 'undefined') {
                            window.g_currentFoncs += '|' + Ext.fly('DEMP_FONC_ID').getValue();
                            // On met à jour l'url de chargement
                            if (typeof (tabs.getActiveTab().getUpdater().defaultUrl) == 'string') {
                                var url_charge = tabs.getActiveTab().getUpdater().defaultUrl;
                            } else {
                                var url_charge = tabs.getActiveTab().getUpdater().defaultUrl();
                            }
                            let url_array = url_charge.split('&');
                            for (let i = 0; i < url_array.length; i++) {
                                if (url_array[i].indexOf('fonc_ids') != -1 && url_array[i].indexOf('-1') == -1) {
                                    url_array[i] += '|' + Ext.fly('DEMP_FONC_ID').getValue();
                                }
                            }
                            tabs.getActiveTab().getUpdater().setDefaultUrl(url_array.join('&'));
                        }
                        update_filtres_besoins();
                        tabs.getActiveTab().getUpdater().refresh();
                    }
                });
            }
        }
        return false;
    }
};

