function home_stats()
{
    var ent_id = Ext.get("entreprise").getValue();
    var stat = Ext.get("stat").getValue(), year = Ext.get("year").getValue(), month = Ext.get("month").getValue(),
        dt = (new Date).getTime();
    var statut = (Ext.get("statut") ? Ext.get("statut").getValue() : 0);
    if (stat == 1) {
        $('#statut').next(".select2-container").show();
        $("#dashboard").html(
            '<div style="width:' + (month > 0 ? 50 : 100) + '%;height:100%;float:left;"><canvas id="es-chart-left"></canvas></div>' +
            (month > 0 ? '<div style="width:50%;height:100%;float:left;"><canvas id="es-chart-right"></canvas></div>' : '')
        );
        $.ajax({
            method: 'GET',
            url: 'data/cgi-bin/cgi_graph.php?action=4&ent_id=' + ent_id + '&statut=' + statut + '&year=' + year + "&dt=" + dt,
            success: function (res) {
                $('#dashboard').append(res);
            }
        });
        if (month > 0) {
            $.ajax({
                method: 'GET',
                url: 'data/cgi-bin/cgi_graph.php?action=5&ent_id=' + ent_id + '&statut=' + statut + '&year=' + year + "&month=" + month + "&dt=" + dt,
                success: function (res) {
                    $('#dashboard').append(res);
                }
            });
        }
    } else {
        $('#statut').next(".select2-container").hide();
        if (stat == 9) {
            $.get('data/cgi-bin/cgi_graph.php?action=9&ent_id=' + ent_id + '&month=' + month + '&year=' + year, function (res) {
                $('#dashboard').html(res);
            });
        } else {
            $("#dashboard").html('<div style="width:100%;height:100%;float:left;"><canvas id="es-chart"</canvas></div>');
            $.ajax({
                method: 'GET',
                url: 'data/cgi-bin/cgi_graph.php?action=' + stat + '&ent_id=' + ent_id + '&month=' + month + '&year=' + year,
                success: function (res) {
                    $('#dashboard').append(res);
                }
            });
        }
    }
}
function home_send_mess(type)
{
    var id = Ext.fly('id_' + type).dom.value;
    var dest = Ext.fly('combo_' + type).dom.value;
    var text = Ext.fly(type + '_text').dom.value;
    if (id === 0 && dest === '' || dest == 'Employé, numéro ou email...') {
        alert('Veuillez saisir un destinataire...');
    }
    else if (text === '') {
        alert('Veuillez saisir un message...');
    }
    else if (confirm("Etes-vous certain(e) de vouloir envoyer cet "+type+" ?\n 'OK' pour l'envoyer, 'Annuler' pour abandonner"))
    {
        Ext.get("message_" + type).setStyle("display", "none");
        Ext.Ajax.request({
            url: "data/cgi-bin/internal_request.php?action=send_message",
            params:
                {
                    sal_id: id,
                    dest: dest,
                    text: text,
                    type: type
                },
            method: 'POST',
            success: function (a) {
                Ext.get("message_" + type).setStyle("display", "none");
                Ext.get("message_" + type + "_error").setStyle("display", "none");
                if (a.responseText == "OK") {
                    a.responseText = "Message correctement envoyé.";
                    Ext.get("message_" + type).update(a.responseText);
                    Ext.get("message_" + type).setStyle("display", "");
                } else {
                    Ext.get("message_" + type + "_error").update("Une erreur est survenue : \n" + a.responseText);
                    Ext.get("message_" + type + "_error").setStyle("display", "");
                }
            }
        })
    }
    ;
}
function home_populate_mess()
{
    if (Ext.get("s")) {
        Ext.get("sms_text").on("focus", function () {
            checklenSMS()
        });
        Ext.get("sms_text").on("mouseup", function () {
            checklenSMS()
        });
        Ext.get("sms_text").on("keydown", function () {
            checklenSMS()
        });
        Ext.get("sms_text").on("keyup", function () {
            checklenSMS()
        });
    }
    var dsSalId = new Ext.data.Store({
        proxy: new Ext.data.ScriptTagProxy({url: "data/cgi-bin/internal_request.php?action=salarie-json"}),
