}();
// validation formulaire
var twValide = function (nForm) {
    var cleanStr = function (str) {
        str = str.replace('SAL_', '');
        while (str.search('_') != -1)
            str = str.replace('_', ' ');
        return str;
    };
    var RdCkOk = false;
    var RdMess = "";
    var CbMess = "";
    var CbCkOk = false;
    var msg = "";
    var fra = "Vous devez remplir tous les champs obligatoires suivants :\n";
    for (var i = 0; i < nForm.elements.length; i++) {
        if (nForm.elements[i].name != '' && varValid.indexOf(nForm.elements[i].name) == -1 && nForm.elements[i].type != 'submit' && nForm.elements[i].type != 'reset' && nForm.elements[i].type != 'button' && nForm.elements[i].type != 'hidden') {
            if (nForm.elements[i].type == 'select-one') {
                if (nForm.elements[i].selectedIndex == 0) {
                    msg += "\n         " + cleanStr(nForm.elements[i].name);
                }
            } else if (nForm.elements[i].type == 'select-multiple') {
                if (nForm.elements[i].selectedIndex < 0) {
                    msg += "\n         " + cleanStr(nForm.elements[i].name);
                }
            } else if (nForm.elements[i].type == 'text' || nForm.elements[i].type == 'email' || nForm.elements[i].type == 'tel') {
                if (nForm.elements[i].value == '') {
                    msg += "\n         " + cleanStr(nForm.elements[i].name);
                }
            } else if (nForm.elements[i].type == 'textarea') {
                if (nForm.elements[i].value == '') {
                    msg += "\n         " + cleanStr(nForm.elements[i].name);
                }
            } else if (nForm.elements[i].type == 'password') {
                if (nForm.elements[i].value == '') {
                    msg += "\n         " + cleanStr(nForm.elements[i].name);
                }
            } else if (nForm.elements[i].type == 'radio') {
                if (nForm.elements[i].checked) {
                    RdCkOk = true;
                    RdMess = "";
                }
                if (RdCkOk == false) {
                    RdMess = "\n         " + cleanStr(nForm.elements[i].name);
                }
            } else if (nForm.elements[i].type == 'checkbox' && CbCkOk == false) {
                if (nForm.elements[i].checked) {
                    CbCkOk = true;
                    CbMess = "";
                }
                if (CbCkOk == false) {
                    CbMess = "\n         " + cleanStr(nForm.elements[i].name);
                }
            }
        }
    }
    if (msg.length != 0 || RdMess.length != 0 || CbMess.length != 0) {
        msg += RdMess + CbMess;
        msg = fra + msg + "\n";
        alert(msg);
        return false;
    }
};
