        let ssid_reel = (nb_aff <= 0 ? Ext.get('ssNomReelInput-' + int_id + '-' + ints_id).getValue() : 0);
        let flag_modif = Ext.get('flag-modif-reel-' + int_id + '-' + ints_id).getValue();
        let chant_id = parseInt(Ext.get('chant_id').getValue());
        if (flag_modif == '1') {
            if (typeof chk_alerts != 'undefined') {
                Ext.Ajax.request({
                    url: 'data/cgi-bin/ajax_prestations.php?action=verif_alertes',
                    params: {
                        int_id: int_id,
                        ints_id: ints_id,
                        qte_ressource: qte_ressource,
                        ddate_reel: ddate_reel,
                        dtime_reel: dtime_reel,
                        edate_reel: edate_reel,
                        etime_reel: etime_reel,
                        hpause_reel: hpause_reel,
                        tpspause_reel: tpspause_reel,
                        ssid_reel: ssid_reel,
                        ssnom_reel: ssnom_reel,
                        nb_aff: nb_aff
                    },
                    method: 'POST',
                    success: function (req) {
                        if (req.responseText === 'NO_RESSOURCE') {
                            alert_jquery('Saisie obligatoire', 'Vous devez saisir une quantité de ressource.');
                            return false;
                        }
                        else if (req.responseText === 'NO_DDATE') {
                            alert_jquery('Saisie obligatoire', 'Vous devez saisir une date de début.');
                            return false;
                        }
                        else if (req.responseText === 'NO_DTIME') {
                            alert_jquery('Saisie obligatoire', 'Vous devez saisir une heure de début.');
                            return false;
                        }
                        else if (req.responseText === 'NO_ETIME') {
                            alert_jquery('Saisie obligatoire', 'Vous devez saisir une heure de fin.');
                            return false;
                        }
                        else if (req.responseText === 'NO_PTIMESTART') {
                            alert_jquery('Saisie obligatoire', 'Vous devez saisir un temps de pause.');
                            return false;
                        }
                        else if (req.responseText === 'FORMAT_DATE') {
                            alert_jquery('Saisie obligatoire', 'Vous devez saisir une date valide au format jj/mm/aaaa');
                            return false;
                        }
                        else if (req.responseText === 'FORMAT_HEURE_DEBUT' ||
                                 req.responseText === 'FORMAT_HEURE_FIN' ||
                                 req.responseText === 'FORMAT_HEURE_PAUSE' ||
                                 req.responseText === 'FORMAT_TEMPS_PAUSE') {
                            alert_jquery('Saisie obligatoire', 'Vous devez saisir une heure valide');
                            return false;
                        }
                        else if (req.responseText === 'TOO_MUCH_PAUSE') {
                            alert_jquery('Saisie des pauses', 'Il y a plus d\'heure de pause que d\'heure de travail.');
                            return false;
                        }
                        else if (req.responseText === 'PAUSE_NEEDED') {
                            alert_jquery('Pause obligatoire', 'Vous devez saisir un temps de pause si il y a plus de 6 heures de travail.');
                            return false;
                        }
                        else if (req.responseText === 'CONSECUTIVE_WORK') {
                            alert_jquery('Temps de travail', 'Vous avez un temps de travail consécutif supérieur à 6 heures');
                            return false;
                        }
                        else if (req.responseText === 'TOO_MUCH_WORK') {
                            alert_jquery('Temps de travail', 'Il ne doit y avoir que 11 heures 30 minutes de travail maximum dans la journée.');
                            return false;
                        }
