//return a formatted number
function formatNumber(value, numberOfDecimal, thousenSeparator, virgule)
{
    value = parseFloat(value).toFixed(numberOfDecimal);
    var val_string = value + '';
    var tmp = val_string.split('.');
    var abs_val_string = (tmp.length === 2) ? tmp[0] : val_string;
    var deci_string = ('0.' + (tmp.length === 2 ? tmp[1] : 0)).substr(2);
    var nb = abs_val_string.length;
    for (var i = 1; i < 4; i++)
        if (value >= Math.pow(10, (3 * i)))
            abs_val_string = abs_val_string.substring(0, nb - (3 * i)) + thousenSeparator + abs_val_string.substring(nb - (3 * i));
    if (parseInt(numberOfDecimal) === 0)
        return abs_val_string;
    return abs_val_string + virgule + (deci_string > 0 ? deci_string : '00');
}
function formatCurrency(price, currencyFormat, currencySign, currencyBlank, hideSign)
{
    // if you modified this function, don't forget to modify the PHP function displayPrice (in the Tools.php class)
    var blank = '';
    price = parseFloat(price).toFixed(2);
    if (typeof hideSign != 'undefined') {
        currencySign = '';
    }
    if (currencyBlank > 0)
        blank = ' ';
    if (currencyFormat == 1)
        return currencySign + blank + formatNumber(price, 2, ',', '.');
    if (currencyFormat == 2)
        return (formatNumber(price, 2, ' ', ',') + blank + currencySign);
    if (currencyFormat == 3)
        return (currencySign + blank + formatNumber(price, 2, '.', ','));
    if (currencyFormat == 4)
        return (formatNumber(price, 2, ',', '.') + blank + currencySign);
    if (currencyFormat == 5)
        return (currencySign + blank + formatNumber(price, 2, '\'', '.'));
    return price;
}
function sec_to_time(duree, human)
{
    var hour = 0;
    var min = 0;
    var sec = 0;
    if (duree) {
        if (duree >= 60) {
            min = Math.floor(duree / 60);
            sec = duree % 60;
        } else {
            sec = duree;
        }
        if (min >= 60) {
            hour = Math.floor(min / 60);
            min = min - hour * 60;
        }
        if (hour < 10) {
            hour = '0' + hour;
        }
        if (min < 10) {
            min = '0' + min;
        }
        if (sec < 10) {
            sec = '0' + sec;
        }
    }
    if (human === true) {
        return hour + "h" + min;
    } else {
        return hour + ":" + min + ":" + sec;
    }
}

var ET_MenuFav = {
    url: '',
    page: '',
    fa: '',
    post_params: [],
    set: function (url, page, fa, post_params) {
        let opacity = (url !== '' ? '1' : '.5');
        $('#menu-fav-add').css('opacity', opacity);
        this.url = url;
        this.page = page;
        this.fa = fa;
        if (typeof post_params === 'undefined') {
            post_params = [];
        }
        this.post_params = post_params;
    },
    save: function () {
        if (ET_MenuFav.url !== '') {
            let name = prompt('Entrer un nom').trim();
            if (name !== '') {
                $.ajax({
                    type: 'POST',
                    url: 'data/cgi-bin/internal_request.php?action=save-menu-fav',
                    data: {
                        url: this.url,
                        name: name,
                        page: this.page,
                        fa: this.fa,
                        post_params: this.post_params
                    },
                    success: function (req) {
                        var res = $.parseJSON(req);
                        if (res.success === true) {
                            $("#menu-fav").append(
                                '<li class="nav-item">' +
