                        $("#menu-fav #menu-fav-del-" + id).remove()
                    }
                }
            });
        }
    }
}

function validate_time_pattern(time)
{
    const time_pattern = /^([0-9]+):[0-5][0-9]$/;
    if (time_pattern.test(time)){
        return true;
    }
    return false;
}
