    calcHoraires: function (sal_id, plg_id, mass = 0)
    {
        var id = sal_id + '_' + plg_id;
        if (mass === 1) {
            id = plg_id;
        }
        var val1 = d_s[id].getRawValue() + '|' + h_s[id].getRawValue() + '|' + d_e[id].getRawValue() + '|' + h_e[id].getRawValue();
        var nb_pause = Ext.select('.dps').elements.length;
        var val2 = [];
        var i = 0;
        dp_s.forEach(function (el, index) {
            val2[i] = dp_s[index].getRawValue() + '|' + hp_s[index].getRawValue() + '|' + dp_e[index].getRawValue() + '|' + hp_e[index].getRawValue();
            i++;
        });
        // val 1 : Les horaires effectuées
        // 25-03-2019|06:00|25-03-2019|13:15
        // val 2 : Les pauses
        return $.ajax({
            type: 'POST',
            url: '?cp=cachets.realise.pauses&action=calc_horaires',
            data: { sal_id: sal_id, plg_id: plg_id, val1: val1, val2: val2, mass: mass},
            success: function (req) {
                Ext.fly('horaires2-manager').update(req, true);
            },
            error: function() {
                alert('NON pris en compte, recommencez svp.')
            }
        });
    },
    // Ajout du champs emargement pour la gestion du transfert des horaires
    updateHoraires: function (sal_id, plg_id, validate, emargement = 0, mass = 0, duree = 0)
    {
        var val1 = '';
        var val2 = '';
        var val3 = '';
        var motif = $('#motif').val();
        var absent = $('#ABSENT').val();
        var phase_custom = $('#RPR_PHASE_CUSTOM').val();
        $('#enr_cancel').hide();
        $('#enr_hp').val('En cours...').attr('disabled', 'disabled');
        $('#enr_valid_hp').val('En cours...').attr('disabled', 'disabled');
        let duree_alerte = 14;
        if (duree <= duree_alerte * 3600 || confirm('La saisie horaire est supérieure à 14h, voulez-vous continuer ?'))
        {
            setTimeout(function ()
            {
                if (emargement != 1)
                {
                    let id = plg_id;
                    if (mass === 0) {
                        id = sal_id + '_' + plg_id;
                    }
                    val1 = d_s[id].getRawValue() + '|' + h_s[id].getRawValue() + '|' + d_e[id].getRawValue() + '|' + h_e[id].getRawValue();
                    val2 = [];
                    var i = 0;
                    dp_s.forEach(function (el, index) {
                        val2[i] = dp_s[index].getRawValue() + '|' + hp_s[index].getRawValue() + '|' + dp_e[index].getRawValue() + '|' + hp_e[index].getRawValue();
                        i++;
                    });
                    if (typeof h_j[id] !== 'undefined' && typeof h_n[id] !== 'undefined' && typeof tdispo[id] !== 'undefined') {
                        val3 = h_j[id].getRawValue() + '|' + h_n[id].getRawValue() + '|' + tdispo[id].getRawValue();
                    }
                }
                // on va vérifier la cohérence des dates de phase et date de pause avant d'aller + loin
                                    // si pas AMP  flux normal de validation
                    update_horaire_modif();
                
                function update_horaire_modif()
                {
                    Ext.Ajax.request({
                        url: '?cp=cachets.realise.pauses&action=update_horaires',
                        params: {
                            sal_id: sal_id,
                            plg_id: plg_id,
                            mass: mass,
                            val1: val1,
                            val2: [val2],
                            val3: val3,
                            motif: motif,
                            absent: absent,
                            emargement: emargement,
                            phase_custom: phase_custom,
                            validate: validate
                        },
                        method: 'POST',
                        success: function (req)
                        {
                            if (req.responseText !== 'OK')
                            {
                                alert_jquery('Une erreur est survenue', req.responseText, '', function()
                                {
                                    $('#enr_cancel').show();
                                    $('#enr_hp').val('Enregistrer').prop('disabled', false);
                                    $('#enr_valid_hp').val('Enregistrer et valider').prop('disabled', false);
                                });
                            }
                            else {
                                close_and_refresh();
                            }
                            function close_and_refresh()
                            {
                                if (emargement != 1)
                                {
                                    if (g_win) {
                                        g_win.close();
                                    }
                                }
                                ET_HorairesRealises.refresh_datatable();
                            }
                        },
                        failure: function () {
                            alert('NON pris en compte, recommencez svp.')
                        }
                    });
                    if (validate) {
                        ET_HorairesRealises.validHoraires(sal_id, plg_id, 1);
                    }
                }
            }, 500);
        }
    },
