function dateen(fr_date, sep = '-')
{
    var year = fr_date.substring(6);
    var month = fr_date.substring(3, 5);
    var day = fr_date.substring(0, 2);
    return year + sep + month + sep + day;
}

function datefr(en_date, sep)
{
    if (typeof sep === 'undefined') {
        sep = '-';
    }
    var day = en_date.substring(8);
    var month = en_date.substring(5, 7);
    var year = en_date.substring(0, 4);
    return day + sep + month + sep + year;
}
