// Fonction pour vérifier si une heure est comprise dans un intervalle
function is_time_range(time, startTime, endTime) {
    return time >= startTime && time <= endTime;
}
// Convertir l'heure au format HH:MM en minutes
function time_to_minutes(time) {
    const [hours, minutes] = time.split(':').map(Number);
    return hours * 60 + minutes;
}

function check_pause_valid_phase(config_date_phase, config_date_pause)
{
    let date_deb_phase = new Date(config_date_phase.date_deb);
    let date_fin_phase = new Date(config_date_phase.date_fin);
    let heure_deb_phase = time_to_minutes(config_date_phase.heure_deb);
    let heure_fin_phase = time_to_minutes(config_date_phase.heure_fin);
    let date_deb_pause = new Date(config_date_pause.date_deb);
    let date_fin_pause = new Date(config_date_pause.date_fin);
    let heure_deb_pause = time_to_minutes(config_date_pause.heure_deb);
    let heure_fin_pause = time_to_minutes(config_date_pause.heure_fin);
    // Vérifier si la date de la pause est comprise dans la plage de dates de la phase
    let is_date_range = date_deb_pause >= date_deb_phase && date_fin_pause <= date_fin_phase;
    // Vérifier si l'heure de début et de fin de la pause sont comprises dans l'intervalle de temps de la phase
    let is_time_in_phase_interval = is_time_range(heure_deb_pause, heure_deb_phase, heure_fin_phase) &&
        is_time_range(heure_fin_pause, heure_deb_phase, heure_fin_phase);
    // Si la date et l'heure de la pause sont toutes deux dans l'intervalle de la phase, la pause est valide
    let is_pause_valid = is_date_range && is_time_in_phase_interval;
    if (is_pause_valid) {
        return true;
    }
    return false;
}

