function toggleGlobalSearch()
{
    let globalSearchClose = function () {
        let searchBarContainer = document.querySelector('#search-bar-container');
        searchBarContainer.classList.remove('is-focused');
        $(document).off('keyup');
        $('#search-bar-container input').off('keyup');
        $(document).off('click', toggleSearchClickOutsideEventListener);
        $('#search-bar-container #search-bar-dropdown li').each(function (idx, el) {
            $(el).off('click');
        });
        return false;
    }
    let toggleSearchClickOutsideEventListener = function (event) {
        let searchBarContainer = document.querySelector('#search-bar-container');
        let target = event.target;
        if (!searchBarContainer.contains(target)) {
            globalSearchClose();
        }
    }
    let keyCode = { left: 37, up: 38, right: 39, down: 40, enter: 13, esc: 27};
    let searchBarContainer = document.querySelector('#search-bar-container');
    let inputSearchBar = searchBarContainer.querySelector('.input-container input');
    if (!$('#search-bar-container.is-focused').length) {
        $(document).on('keyup', function (e) {
            if (e.which === 27) {
                return globalSearchClose();
            }
            if ($.inArray(e.which, [keyCode.left, keyCode.up, keyCode.right, keyCode.down, keyCode.enter]) < 0) { return; }
            // On appuie sur ENTER
            if (e.which === keyCode.enter && $('#seach-bar-dropdown-results .col-3 .info-box.active').length > 0) {
                $('#seach-bar-dropdown-results .info-box.active > a').simulate('click');
                return false;
            }
            let flag = false;
            let elToActivate = null;
            let elPrevious = null;
            // On se déplace avec les flèches sur le prochain item
            $('#seach-bar-dropdown-results .col-3 .info-box').each(function (idx, el) {
                if ((e.which === keyCode.right || e.which === keyCode.down) && flag === true) {
                    elToActivate = $(el);
                    return false; // quitte le each
                }
                if ((e.which === keyCode.left || e.which === keyCode.up) && flag === true) {
                    elToActivate = $(elPrevious);
                    return false;
                }
                if ($(el).hasClass('active')) {
                    flag = true;
                } else {
                    elPrevious = el;
                }
            }).removeClass('active');
            if (elToActivate === null) {
                elToActivate = $('#seach-bar-dropdown-results > div:nth-child(2) > div > div:nth-child(1) > div');
            }
            if (elToActivate.length > 0) {
                elToActivate.addClass('active');
                $('#seach-bar-dropdown-results').scrollTo(elToActivate).scrollTo("-=20px");
            }
        });
        searchBarContainer.classList.add('is-focused');
        inputSearchBar.focus();
        $(document).on('click', toggleSearchClickOutsideEventListener);
        let globalSearchPost = function()
        {
            let query = $('#search-bar-container input').val();
            let context = [];
            $('#search-bar-dropdown-context li.active').each(function () {
                context.push($(this).data('context'));
            })
            $.ajax({
                type: 'POST',
                url: 'data/cgi-bin/internal_request.php?action=global-search',
                data: {
                    query: query,
                    context: context
                },
                success: function (res) {
                    $('#seach-bar-dropdown-results').html(res);
                    $('#seach-bar-dropdown-results .info-box').on('click', function() {
                        let h = $(this).find('a').attr('href')
                        if (h) {
                            window.location = h;
                        }
                    })
                }
            });
        }
        $('#search-bar-container input').on('keyup', ET.delay(function (e) {
            if ($.inArray(e.which, [keyCode.left, keyCode.up, keyCode.right, keyCode.down, keyCode.enter, keyCode.esc]) !== -1) { return; }
            globalSearchPost()
        }, 250))
        $('#search-bar-container #search-bar-dropdown-context li').each(function (idx, el) {
            $(el).on('click', function () {
                let context = this.innerText.trim();
                if (this.classList.contains('active')) {
                    this.classList.remove('active');
                    let contextSpan = inputSearchBar.parentNode.querySelector(`span[data-context="${context}"]`);
                    if (contextSpan) {
                        contextSpan.remove();
                    }
                } else {
                    this.classList.add('active');
                    let contextSpan = document.createElement('span');
                    contextSpan.textContent = context;
                    contextSpan.dataset.context = context; // Ajoute un attribut de données pour identifier le contexte
                    inputSearchBar.parentNode.insertBefore(contextSpan, inputSearchBar.nextSibling);
                }
                globalSearchPost();
            });
        });
        globalSearchPost();
    }
    return false;
}
