function show_error_emargement_mass_amp(req)
{
    let is_emarg = false;
    let is_indispo = false;
    var response_validation_mass_emarg = JSON.parse(req);
    for (var itemId in response_validation_mass_emarg)
    {
        if (response_validation_mass_emarg.hasOwnProperty(itemId))
        {
            var item = response_validation_mass_emarg[itemId];
            if (item.INDISPOS === true )
            {
                if ($('.horaire_emargement_' + itemId).length > 0) {
                    $('.horaire_emargement_' + itemId).css('color', 'orange');
                }
                is_indispo = true;
            }
            if (item.EMARG)
            {
                is_emarg = true;
                let row_to_color_red = $('#valid' + itemId).parent().parent();
                if (row_to_color_red.length > 0)
                {
                    var couleur = 'rgba(220, 20, 60, 0.5)';
                    row_to_color_red.css('background-color', couleur);
                }
                if ($('.horaire_emargement_' + itemId).length > 0) {
                    $('.horaire_emargement_' + itemId).css('color', 'red');
                }
            }
        }
    }
    if (is_emarg === false && is_indispo === true) {
        alert_jquery('Information Indispos', 'Il existe des indispos sur certains émargements (émargement en orange) mais ils sont tout de même validés.');
    }
    if (is_emarg === true && is_indispo === false) {
         alert_jquery('Emargement', 'Les lignes en rouge sont les émargement qui n’ont pas été validés car ils sont à cheval sur une autre phase déjà validée.');
    }
    if (is_emarg === true && is_indispo === true) {
        alert_jquery('Emargement', 'Les lignes en rouge sont les émargement qui n’ont pas été validés car ils sont à cheval sur une autre phase déjà validée. Il existe également des indispos mais validés (émargement en orange).');
    }
}
function show_error_tr_mass_amp(req)
{
    let response_TR = JSON.parse(req);
    let is_blocage_ecole = false;
    let is_blocage_deja_tr_sur_jour = false;
    for (var i = 0; i < response_TR.length; i++)
    {
        if ('MOTIF' in response_TR[i])
        {
            if (response_TR[i].MOTIF == 'ecole') {
                is_blocage_ecole = true;
            }
            else if (response_TR[i].MOTIF == 'already') {
                is_blocage_deja_tr_sur_jour = true;
            }
        }
    }
    if (is_blocage_ecole && is_blocage_deja_tr_sur_jour) {
        alert_jquery('Ticket Restaurant', 'Certains tickets restaurants ne sont pas validés car il existe déjà un ticket restaurant le même jour. Egalement, les Tickets restaurants sont interdits sur les phases écoles');
    }
    if (!is_blocage_ecole && is_blocage_deja_tr_sur_jour) {
        alert_jquery('Ticket Restaurant', 'Certains tickets restaurants ne sont pas validés car il existe déjà un ticket restaurant le même jour');
    }
    if (is_blocage_ecole && !is_blocage_deja_tr_sur_jour) {
         alert_jquery('Ticket Restaurant', 'Les tickets restaurants ne sont pas autorisés sur les phases de type Ecole.');
    }
}
function show_error_nhd_mass_amp(req){
    let response_hdr = JSON.parse(req);
    let msg_error = '';
    let invalide_nuit_hordom = false;
    let other_nhr_same_day = false;
    response_hdr.forEach(function (response)
    {
        if (response.MOTIF == 'invalide_nuit_hordom') {
            invalide_nuit_hordom = true;
        }
        else if (response.MOTIF == 'other_nhr_same_day') {
            other_nhr_same_day = true;
        }
    });
    if (other_nhr_same_day && invalide_nuit_hordom) {
        msg_error = 'Les nuits hors domicile ne sont pas autorisés sur les phases de type voyage retour et certains jours ont déjà des nuit hors domicile validés';
    }
    else if (other_nhr_same_day && !invalide_nuit_hordom) {
        msg_error = 'Certains jours ont déjà des nuit hors domicile validés';
    }
    else if (!other_nhr_same_day && invalide_nuit_hordom) {
        msg_error = 'Les nuits hors domicile ne sont pas autorisés sur les phases de type voyage retour';
    }
    alert_jquery('Nuit hors domicile', msg_error);
}
function controle_phase_ecole_amp(config) {
    let [heure_deb, minute_deb] = config.time_deb.split(':').map(Number);
    let [heure_fin, minute_fin] = config.time_fin.split(':').map(Number);
    let heures = heure_fin - heure_deb;
    let minutes = minute_fin - minute_deb;
    // Vérifier s'il y a une pause
    if (config.pause_deb !== '' || config.pause_fin !== '')
    {
        alert_jquery('Erreur', 'Pas de pause sur phase de type école');
        return false;
    }
    // Vérifier si la phase de type école fait exactement 7 heures et 0 minutes
    if (heures === 7 && minutes === 0) {
        return true;
    }
    else
    {
        alert_jquery('Erreur', 'Une phase de type école doit faire 7:00');
        return false;
    }
}
function displayGantt(opts)
{
    opts = $.extend({el: null, chantId: null, canOpen: true, cgiPrefix: '', resources: '', events: '', defaultDate: null}, opts);
    $(opts.el).fullCalendar('destroy');
    if (opts.resources === '') {
        opts.resources = opts.cgiPrefix + 'data/cgi-bin/cgi_graph.php?action=3&id=' + opts.chantId + '&type=resources';
    }
    if (opts.events === '') {
        opts.events = opts.cgiPrefix + 'data/cgi-bin/cgi_graph.php?action=3&id=' + opts.chantId + '&type=events';
    }
    $(opts.el).fullCalendar({
        schedulerLicenseKey: '0764627982-fcs-1637937280',
        height: 'auto',
        defaultDate: opts.defaultDate,
        eventMouseover: function (event) {
            return get_plg_data(event.idPhase)
        },
        eventMouseout: function (event) {
            return ndx(500)
        },
        eventClick: function (event) {
            if (opts.canOpen) {
                popUp('?cp=planning.event&eventid=' + event.idPhase, 660, 600);
            }
        },
        header: {
            left: 'today prev,next',
            center: 'title',
            right: 'timelineDay,timelineWeek,timelineMonth,timelineYear,listWeek'
        },
        defaultView: 'timelineMonth',
        resourceAreaWidth: '35%',
        resourceColumns: [
            {
                group: true,
                labelText: 'Equipe',
                field: 'team'
            },
            {
                labelText: 'Phase',
                field: 'title'
            }
        ],
        resourceRender: function (resourceObj, $td) {
            if ($td.length === 2) {
                $td.eq(1).find('.fc-cell-text').html(resourceObj.title);
            } else if ($td.length === 1) {
                $td.find('.fc-cell-text').html(resourceObj.title);
            }
        },
        resources: opts.resources,
        events: opts.events
    });
}
