var changes;
function removeDiacritics (str) {
    if(!changes) {
        changes = defaultDiacriticsRemovalMap;
    }
    for(var i=0; i<changes.length; i++) {
        str = str.replace(changes[i].letters, changes[i].base);
    }
    return str;
}

Ext.apply(Ext.data.SortTypes, {
    asNaturalDateInterval: function (str) {
        //permet de transformer les dates au format année mois jour heures minute.
        //18/12/16 de 08:00 à 18:00 devient 1612170800
        //01/08/16 à 09:40 au 02/12/21 à 08:00 devient 1608010940
        //01/08/16 from 09:40 au 02/12/21 à 08:00 devient 1608010940
        //01/08/16 at 09:40 au 02/12/21 à 08:00 devient 1608010940
        return str.replace(/(\d{2})\/(\d{2})\/(\d{2})\ (?:de|à|from|at)\ (\d{2})\:(\d{2}).*/g, "$3$2$1$4$5");
    }
});
// GD: permet de filter une collection en ignorant les accents (pour un ComboBox)
Ext.override(Ext.util.MixedCollection, {
    filterBy: function (fn, scope) {
        let r = new Ext.util.MixedCollection();
        r.getKey = this.getKey;
        let k = this.keys, it = this.items;
        for (let i = 0, len = it.length; i < len; i++) {
            it[i]._data = Object.assign({}, it[i].data); // on clone
            for (var idx in it[i].data) {
                if (typeof it[i].data[idx] === 'string') {
                    it[i].data[idx] = removeDiacritics(it[i].data[idx]);
                }
            }
            if (fn.call(scope || this, it[i], k[i])) {
                it[i].data = it[i]._data;
                r.add(k[i], it[i]);
            } else {
                it[i].data = it[i]._data;
            }
        }
        return r;
    }
});
Ext.override(Ext.form.ComboBox, {
    anyMatch: true,
    caseSensitive: false,
    listeners: {
        beforequery: function (query) {
            // pas de custom sur les TimeField, ça ne focus pas la sélection
            if (this.format && this.format === 'H:i') {
                return query;
            }
            // pas de custom sur une recherche AJAX
            if (this.store.proxy instanceof Ext.data.ScriptTagProxy) {
                return query;
            }
            let me = this;
            let queryString = removeDiacritics(query.query) || '';
            if (queryString.length >= me.minChars) {
                queryString = queryString.replace(/([-.*+?^${}()|[\]\/\\])/g, "\\$1");
                if (me.anyMatch !== true) {
                    queryString = '^' + queryString;
                }
                query.query = new RegExp(queryString, 'i');
                query.query.length = me.minChars; // this is a trick
            }
        }
    }
});
