Ext.form.ColorField = function(config){
    Ext.form.ColorField.superclass.constructor.call(this, config);
};
Ext.extend(Ext.form.ColorField, Ext.form.TriggerField,  {
    
    invalidText : "'{0}' n'est pas une couleur valide - elle doit tre au format hexadcimal {1}",
    
    triggerClass : 'x-form-color-trigger',
    
    // private
    defaultAutoCreate : {tag: "input", type: "text", size: "10", maxlength: "7", autocomplete: "off"},
    // Limit input to hex values
    maskRe: /[#a-f0-9]/i,
    regex: /[#a-f0-9]/i,
    // private
    validateValue : function(value){
        if(!Ext.form.ColorField.superclass.validateValue.call(this, value)){
            return false;
        }
        if(value.length < 1){ // if it's blank and textfield didn't flag it then it's valid
             return true;
        }
        var parseOK = this.parseColor(value);
        if(!value || (parseOK == false)){
            this.markInvalid(String.format(this.invalidText, value, '#AABBCC'));
            return false;
        }
        return true;
    },
    // private
    // Provides logic to override the default TriggerField.validateBlur which just returns true
    validateBlur : function(){
        return !this.menu || !this.menu.isVisible();
    },
    
    getValue : function(){
        return Ext.form.ColorField.superclass.getValue.call(this) || "";
    },
    
    setValue : function(color){
        Ext.form.ColorField.superclass.setValue.call(this, this.formatColor(color));
    },
    // private
    parseColor : function(value){
        this.colorbox.setStyle('background', value);
        return (!value || (value.substring(0,1) != '#')) ?
                false : true;
    },
    // private
    formatColor : function(value){
        if (value && (this.parseColor(value) == false)) {
                value = '#' + value;
        }
        this.colorbox.setStyle('background', value);
        return value;
    },
    // private
    menuListeners : {
        select: function(e, c){
            this.setValue(c);
        },
        show : function(){ // retain focus styling
            this.onFocus();
        },
        hide : function(){
            this.focus();
            var ml = this.menuListeners;
            this.menu.un("select", ml.select,  this);
            this.menu.un("show", ml.show,  this);
            this.menu.un("hide", ml.hide,  this);
        }
    },
    // private
    // Implements the default empty TriggerField.onTriggerClick function to display the ColorPalette
    onTriggerClick : function(){
        if(this.disabled){
            return;
        }
        if(this.menu == null){
            this.menu = new Ext.menu.ColorMenu();
        }
        this.menu.on(Ext.apply({}, this.menuListeners, {
            scope:this
        }));
        this.menu.show(this.el, "tl-bl?");
    },
	//private
	onRender : function(ct, position){
		Ext.form.ColorField.superclass.onRender.call(this, ct, position);
		this.colorbox = this.container.createChild({tag: "div", style:"padding:0;margin:0;border: 1px solid;margin-right:3px;background: #fff;float:left;height: 12px;width: 12px;position:relative;top:3px;"},this.el.dom);
    },
    
	//private
    //set new width
    adjustWidth : function(tag, w){
        if(typeof w == 'number' && (Ext.isIE && (Ext.isIE6 || !Ext.isStrict)) && /input|textarea/i.test(tag) && !this.inEditor){
            return w - 3;
        }
        return (w-17);
	}
});
